<script>
import TheBreadcrumbs from "~/components/TheBreadcrumbs.vue";
import {
  getTopper,
  getLayout,
  formatPrice,
  getBestDeal,
  sizeImage,
  getAffiliateLink,
} from "~/components/API.js";

export default {
  components: {
    TheBreadcrumbs,
  },
  async asyncData({ params, query, error }) {
    const layout = await getLayout("topper_page");

    const topper = await getTopper({ slug: params.slug });
    console.log(topper.products);

    if (!topper || !topper.products) {
      return error({ statusCode: 410, message: "Page not found" });
    }

    const breadcrumbItems = [
      {
        text: "Home",
        disabled: false,
        href: "/",
      },
      {
        text: "Toppers",
        disabled: false,
        href: "/toppers",
      },
      {
        text: topper.title,
        disabled: true,
        href: "/",
      },
    ];
    topper.products.sort((a, b) => a.topperInfo.rank - b.topperInfo.rank);
    for (const product of topper.products) {
      const { besteDealUrl, lowestPrice, besteDealStore, besteDealStoreImage } =
        getBestDeal(product, `topper ${params.slug}`);
      // console.log('LOWEST PRICE', lowestPrice)
      product.besteDealUrl = besteDealUrl;
      product.lowestPrice = lowestPrice;
      product.besteDealStore = besteDealStore;
      product.besteDealStoreImage = besteDealStoreImage;
      product.displayModal = false;
      product.storeproducts.sort((a, b) => a.price - b.price);
      product.storeproducts = product.storeproducts.filter(
        (sp) => sp.isAvailable
      );
      for (const storeproduct of product.storeproducts) {
        storeproduct.percentage =
          ((storeproduct.price - lowestPrice) / lowestPrice) * 100;
      }
      product.image = sizeImage(product.image, 200, 200);
    }
    const forceShowAll =
      !topper.description || topper.description.split(" ").length <= 30;
    return {
      slug: params.slug,
      showAllExplanation: false,
      showAllDescription: forceShowAll,
      forceShowAll,
      topper,
      products: topper.products,
      title: topper.title,
      description: topper.description,
      layout,
      breadcrumbItems,
    };
  },
  data() {
    return {};
  },
  head() {
    return {
      title: this.topper.productType
        ? `De Beste ${this.topper.productType} [${this.topper.lastUpdateMonth} ${this.topper.lastUpdateYear}]`
        : this.title,
    };
  },
  /*
  beforeMount () {
    window.addEventListener('scroll', this.handleScroll)
  },
  destroyed () {
    window.removeEventListener('scroll', this.handleScroll)
  }, */
  methods: {
    getAffiliateLink(sp, ref) {
      return getAffiliateLink(sp, ref);
    },
    formatPrice(price) {
      return formatPrice(price);
    },
    sizeImage(image, width, height, imagetype = "product") {
      return sizeImage(image, width, height, imagetype);
    },
    toggleShowAllDescription() {
      this.showAllDescription = !this.showAllDescription;
    },
    toggleShowAllExplanation() {
      this.showAllExplanation = !this.showAllExplanation;
    },
  },
};
</script>

